import React from 'react';
import './carrito.css';
import Producto from './Producto';

const Carrito = ({carrito}) => (
    <div className="carrito">
        <h2>Carrito de compras</h2>

        {carrito.length === 0
        ?<p>Cero productos en el carrito</p>
        : carrito.map(producto => (
                <Producto
                  key={producto.id}
                  producto ={producto}
                />
        ))}

    </div>
);

export default Carrito;
